Our input, however, is very different, we don't know what's going to be in here at all at compile time. In order to store the data that the user gives us, we still need to put it in memory somewhere, but it can't live on the stack. Instead, we use another kind of memory called "the Heap". At any point while the program is running, we can ask the operating system to allow us to access some amount of memory. We still need to know how much memory we need, but now we only need to know how much memory at runtime. This memory comes from the Heap. In the heap, we can store "Unsized" data (as well as Sized which can be useful under certain circumstances) and, then because everything about the location of that data is Sized, we can store it in a variable on the stack. String does not contain the data, but does know where the data is. Some other important differences between the Stack and the Heap. The Stack is more limited in size, you should try to avoid storing large amounts of data here (even if the size is known). Creating memory on the Heap takes longer than creating it on the Stack, this is because you have to communicate your requirements to the operating system and wait for it to get back to you with that allocation. This doesn't take too long, but one thing to watch out for is repeatedly increasing the amount you need. If you create a string of a certain size, then ask for more memory (eg, by appending more data to it), then in the background Rust will ask the operating system for a new, larger block of memory, then it has to copy the old data to it, before adding anything else on to the end. This is all great, but why is one of them &str and one of them String if both of them are just references to data stored elsewhere? This actually comes down to "ownership". We'll go into ownership in more detail later in a later chapter but at a very high level a reference to a string slice does not own the string data. Ownership allows full control over the data, and most importantly, it tells the program when to clean up the data. When an &str is no longer needed, the reference is cleaned up, but the data still exists. When a String is no longer needed, not only is the reference cleaned up, but memory is returned to the operating systems control, freeing it up for something else to use. It's important to note though that &str and String are different types. The data they reference is formatted the same way in memory, but they are not interchangeable. Later, when we discuss functions, you'll see that if a function requires a String you can not pass it a &str and vice versa. You can, however, trivially go from one to another. #fn main() {
let name = "Daniel"; // This is a &str pointing at a sequence of bytes in the executable
let name_on_heap = String::from(name); // This requests memory from the operating system then copies "Daniel" into it
let name_ref = name_on_heap.as_str(); // This is a &str pointing to a sequence of bytes on the heap
#} That said, they can be compared to each other (this actually goes for any data type in Rust so long as someone has told Rust how to do the comparison, which for &str and String, someone has). Let's return to our program one last time. Below I've written out the full program and added an if/else statement. if/else is a form of control flow. We put an expression inside the "if" that evaluates to either true or false, in this case we're asking if input is equal to actual. If it is, then the execution continues inside the if block (the bit between the curly brackets), if it's not true, then instead execution continues inside the else block. fn main() { let actual = "blue"; println!("Welcome to the guessing game!"); println!("I have chosen a color red, green or blue"); println!("Enter your guess: red, green or blue"); let input = std::io::stdin() .lines() .next() .expect("No input was read") .expect("There was an error when reading the input"); println!("Your guess was {input}"); println!("The color I chose was {actual}"); if input == actual { println!("you win!"); } else { println!("you lose!"); }
}

