Now that you've had that primer on binary, I bet those 12 different integer types are starting to make a lot more sense! The most basic number type in Rust is the u8. This is an unsigned integer (represented by the u) that is 8 bits in length. Unsigned means that the number can only be positive (it does not have a negative sign). You might have already guessed, but this is one byte, and can hold the numbers 0 to 255. A byte like this can be used for all sorts of things, though one common example is as part of a color. We often represent colors as 8 bits of red, 8 bits of green, 8 bits of blue and sometimes 8 bits of transparency. i8 is an integer that can represent both positive and negative numbers (i.e. it's signed). It also only uses 8 bits of data but in order to represent a number, however, instead of going from 0 to 255, it goes from -128 to 127. You never need to know this, but , if you're interested in the mathematics of how it does this, it uses a method called two's complement . This, however, is complicated, and we don't think like computers. The easiest way to think about it is the left most column is the negative version of itself, and all other numbers are the same. So, the number -125 can be represented as 0b1000_0011. Columns: -128 64 32 16 8 4 2 1 Count: 1 0 0 0 0 0 1 1 ie, the number contains one -128, one 2 and one 1, adding (-128 + 2 + 1) them is -125. So that's u8 and i8, and now you've probably guessed that for all the other integer types; u means it can only be positive i means it can be positive or negative the number after is how many bits are available to the number Now we can build up a little table to show the minimum and maximum of these types: type min max u8 0 255 i8 -128 127 u16 0 65,535 i16 -32768 32,767 u32 0 4,294,967,295 i32 -2147483648 2,147,483,647 u64 0 18,446,744,073,709,551,615 i64 -9,223,372,036,854,775,808 127 u128 0 340,282,366,920,938,463,463,374,607,431,768,211,455 i128 -170,141,183,460,469,231,731,687,303,715,884,105,728 170,141,183,460,469,231,731,687,303,715,884,105,727 Wow, those numbers get big fast! There's still two types missing though; usize and isize. In this case, the size is also acting as the number of bits, however, unlike the other integer types, the size of size is variable. Rust is a compiled language, meaning that the code you write in Rust is transformed into instructions that a CPU can understand. CPUs are all different, but they typically follow some given "architecture". For example, if you're reading this on a Windows or Linux desktop or an Intel Mac, the architecture of your CPU is probably x86_64. If you're reading this on an "Apple Silicon" Mac or a mobile phone, then the architecture is probably arm64. A quick aside, the world of CPU architecture is a bit of a mess so x86_64 may also be referred to as amd64 as AMD were the designers of the architecture, but it was designed to be backwards compatible with Intel's x86 architecture. Similarly arm64 is also sometimes referred to as AArch64. When you compile Rust it will compile into an instruction set for the architecture your machine uses, though you can also tell it what instruction set to compile for if you want to build it on one architecture but run it on another. x86_64 and arm64 are both 64bit architectures, so when you build for these machines, the size in usize and isize becomes 64. However, if you were to compile for, say, a Cortex-M0 chip, then the instruction set would likely be Thumb-1 which is 16bit so the size in usize and isize becomes 16. Which integer is right for you? You might think the obvious thing to do would be to use the largest possible number, for example, you can fit pretty much every whole number you could possibly need into i128, so why use anything else? There's two things to think about, first, what is the intended use of the number and, second, what is the architecture of the machine you're running on? In software engineering, a number is never just a number, it represents something. As we mentioned earlier, colors are often (but not always), represented as 0 to 255 for each of red, green and blue. This means that a u8 is the best way to store these. If you combine those three colors with another 8 bits for transparency (alpha), then you have four lots of u8 which can be represented as a u32. u8 is also a good size for representing a stream of unicode characters, which is where we get UTF-8, the default encoding for Rust strings. For larger numbers though, you still may not want to use the largest. While you can use integers that are wider than the architecture that you're running your program on, like using a u128 ion a 64 bit machine, mathematics with those numbers will be slower. The CPU can only process so many bits at once, so when it has numbers larger than that, it has to do multiple rounds of processing to achieve the same results as it might have done if those numbers were stored in smaller integers. You might then think that the best thing to do is use a usize or isize if you don't really care about how big a number can get, and that's fine, and I often do this, but now you have to bear in mind that the behaviour of your program may no longer be consistent on different machines! By default, when you write an integer and store it in a variable, Rust will play it safe and use an i32 as it doesn't know what you might want to do with the number, an i32 will fit inside most CPU architectures without needing extra work and allows negative numbers. let a = 10; // i32 However, it is more idiomatic to be intentional about the types you use. My methodology here is roughly: does this number represent something of a specific size like a color or ascii character, in which case, use that size is this number going to be used to access an array, in which case it really ought to be a usize am I more worried about the number slowing the program down than I am about accidentally trying to store a big number in a small integer, and do I not care about consistency, in which case usize or isize otherwise, if I'm ok potentially sacrificing speed, then an i32 or i64 is fine You can specify what type a number is either by annotating the variable you are putting it inside: let a: u64 = 10; // u64 Or, if that's not possible because you are, for example, passing the number to a function that could take many number types, you can write the type at the end of a number: #use std::fmt::Display;
#
#fn print_value_and_type<T: Display>(v: T) {
# let type_name = std::any::type_name::<T>();
# println!("Type of '{v}' is {type_name}");
#}
#
#fn main() {
print_value_and_type(10u8); // u8
#} A brief note on Type Conversion Finally, you can convert between types in several ways, which we'll talk about more later, but I wanted to quickly go over some code from the last chapter. In the bonus section of the last chapter, we got the number of milliseconds that had passed since midnight on the 1st of January 1970, and then immediately used as usize: let time = std::time::UNIX_EPOCH .elapsed() .expect("Call the doctor, time went backwards") .as_millis() as usize; // We only need the least significant bits so this is safe The reason for this is the number of milliseconds since that date is approximately 1,710,000,000,000 and is returned as a u128. We wanted to use this as part of a calculation to work out an index into an array. Indexes in arrays are always usize. If you were to compile this program on a 32bit architecture, then the number of milliseconds is greater than what would fit into a usize which would be a mere 4,294,967,295. When we use as it simply takes the number, whatever it is and tries to cram it into the size as <type>. When going from a larger size to a smaller size (in this case, from u128 to the equivalent of u32) it simply cuts off the front of the data, leaving the least significant bits. You can see this in the following program (don't forget you can run this in place with the play button): #fn main() {
let time = std::time::UNIX_EPOCH .elapsed() .expect("Call the doctor, time went backwards") .as_millis(); let time_u32 = time as u32; println!("Before conversion: {time}");
println!("After conversion: {time_u32}");
